import React from 'react';

import { AboutDescription } from './about.styles';

const AboutPage = (props) =>{

  return (
    <>
      <h1>About</h1>
      <AboutDescription>Dale Street Studio is a Mixing, Mastering and Production studio that's capable of assisting musicians in a myriad of ways.
      Including artist promotion & web development.</AboutDescription>

      <AboutDescription>As a longtime DJ and musician since 1999, Marcus Norwood, aka DJ Definition (hiphop) and M.D. Norwood (blues), started tDale St. to represent his growing studio.
      Focusing on various production and engineering techniques he's learned over the years. With the hope of
      turning the studio into a full fledged tracking studio with high quality solutions and scenic mountain views.</AboutDescription>
      <AboutDescription>Keep an eye out for our artist promotion page to see various projects and clients. If you're interesting in licensing</AboutDescription>
      <AboutDescription>Let me know how you'd like me to help on your project. Whether needing an for your next album. Feel free to check out my library of available instrumentals. Or just needing the
      final touches on a high quality master. Using hybrid analog and digital mastering solutions, contact me today to book my services. Now taking clients!</AboutDescription>
      <button onClick={() => props.history.push('/')}>Home</button>
  </>
  )
};




export default React.memo(AboutPage);
